        <div >

            {pokemons.map((p, index )=> {
                console.log(p["type_one"])
                return filter === "" || p["type_one"] === filter ?  <div key={index}>

                    <h4 > {p.name}:</h4>
                    <DisplayAttributes p={p} ></DisplayAttributes>
                </div> : <></>
            })}
